import { Box } from '@mui/material'
import { imageUrl } from '../../Constants/data'

const MidSection = () => {
    return (
        <Box>
            {
                  imageUrl.map(image => (

                    <img src={image} alt= "img"/>
                  ))
            }
        </Box>

    )
}

export default MidSection
